MongoDB - How to retrieve multiple collections from an array of objects that have their IDs<p>So, I have a database with the following collections. </p>

<p>(Using Integers to represent the object IDs)</p>

<p><strong>Books:</strong></p>

<pre><code>books = [
  { _id: 1, title: "Harry Potter" },
  { _id: 2, title: "The maze runner" }
  ...
]
</code></pre>

<p><strong>Customers:</strong> </p>

<pre><code>customers = [
  { _id: 1, name: "John" },
  { _id: 2, title: "Jane"}
  ...
]
</code></pre>

<p><strong>Recommendations:</strong> </p>

<pre><code>recommendations = [
  {
    customerID: 1,
    recommendations: [
      { bookID: 1, likelihood: 0.9 },
      { bookID: 2, likelihood: 0.8 }
    ]
  },
  {
    customerID: 2,
    recommendations: [
      { bookID: 2, likelihood: 0.9 },
      { bookID: 1, likelihood: 0.8 }
    ]
  }
  ...
]
</code></pre>

<p>Now when a request is sent to my server, containing <code>customerID</code> in the <code>req.body</code>, i want to return the recommended books for that customer, with the likelihood appended to them.</p>

<p><strong>i.e :</strong></p>

<pre><code>desiredResult = [
  {
    _id: 1,
    title: "Harry Potter",
    likelihood: 0.9
  },
  {
    _id: 2,
    title: "The maze Potter",
    likelihood: 0.8
  }
  ...
]
</code></pre>

<p>Please, what is the MongoDB aggregation query to achieve this ?</p>

