Proper way to loop through items in large JSON, modify them and insert one by one into a collection in mongodb<p>I'm getting a large JSON from a request to an url, then I want to loop through all of them and make some changes in its JSON objects and, here is where I'm having problems, I want to insert each modified JSON item to a collection in the mongodb.</p>

<p>I'm totally new to all that technologies, nodejs, express and mongodb. Will appreciate all the possible guidance in this process to learn to develop on this technologies.</p>

<pre><code>//The request that gets the JSON and sends to the function to handle it
async.auto({
    'gatheringteams': [function (callback) {

        request(url, function (error, response, body) {
            if (!error &amp;&amp; response.statusCode == 200) {
                var sendresults = require('./public/javascripts/teams.js');
                sendresults.storeTeams(body);
            } else {
                console.log('error' + response.statusCode);
            }
        });

        callback(null);
    }],
},
    function (err, results) {
        if (err) {
            console.log(err);
        }
    }
);



//The function receiving the JSON
function storeTeams(results) {
    var parsed = JSON.parse(results);
    var getdbdefinition = require('./db');
    var dbconnection = getdbdefinition.getDb();
    var db = dbconnection.db('teamsdb');

    for (let key in parsed) {
        let parsedobject = parsed[key];
        db.collection('players').insertOne(parsedobject, function (err, result) {

            if (err) {
                console.log('Error!')
            }

            if(result){
                console.log('Inserted!');
            }

        });
    }
};
</code></pre>

<p>The problem is that, for some reason, insertone is inserting only 50 items, the rest are not inserted and I'm not getting errors to have a clue what I'm doing wrong. (as you can see I didn't modify the JSON objects, I try to insert them as they are, but doesn't work either)</p>

