Mongoose $elemMatch with multiple of the same property<p>I'm trying to <code>find()</code> with Mongoose with the following query:</p>

<pre><code>let users = await models.users.find({
  inv: { $elemMatch: { name: "Some Item", name: "Another Item" } }
});
</code></pre>

<p>These documents should be found:</p>

<pre><code>{
  inv: [{ name: "Some Item", amount: 5 }]
}
//and
{
  inv: [{ name: "Another Item", amount: 15 }]
}
//and
{
  inv: [{ name: "Some Item", amount: 5 }, { name: "Another Item", amount: 15 }]
}
//and
{
inv: [{ name: "Some Item", amount: 5 }, { name: "Another Item", amount: 15 }, { name: "Different Item", amount: 1 }]
}
</code></pre>

<p>But these shouldn't:</p>

<pre><code>{
  inv: [{ name: "Different Item", amount: 1 }]
}
//and
{
  inv: []
}
</code></pre>

<p>This works fine with regular MongoDB queries, but with Mongoose, this is a problem since you can't have multiple of the same properties in a JavaScript object (<code>name</code> and <code>name</code> in this case). How should I go about handling this?</p>

