mongoose-paginate with react and material-ui TablePagination - second page onwards not rendering after clicking of onChangePage prop<p>I am relatively new to React, and in this React component I must be missing something basic. Will greatly appreciate any guidance towards the solution.</p>

<p><strong>Functionlaity I am trying to achieve here</strong> - Implementing a pagination with <a href="https://www.npmjs.com/package/mongoose-paginate" rel="nofollow noreferrer">mongoose-paginate</a> in the backend and Material-UI <strong><a href="https://material-ui.com/api/table-pagination/" rel="nofollow noreferrer">TablePagination</a></strong> in the front-end. So each time, the user clicks on the next-page icon (a forward or backward arrow) there will be a database call with axios.get and data will be fetched from mongo and rendered in a table in the UI.</p>

<p>To achieve this, I have  the handleChangePage() function in React whcih will invoke the axios.get function.</p>

<p><strong>The issue</strong> - From the second page onwards data are not rendeiring, but with console.log, I can see (in the chrome-devtool) that the data were indeed fetched from backend after clicking on the next page icon. But that fetched data is not getting rendered in the UI. </p>

<p>This is the React code in my rendering component. The key function is <strong>handleChangePage()</strong> , this is where I do the database call to fetch the data each time, user clicks on the next page icon (next page icon is that of Material-UI <strong>TablePagination</strong> component)</p>

<pre><code>class List extends Component {
  constructor(props) {
    super(props);
    this.state = {
      allDevelopmentWorks: [],
      allDevelopmentWorksFormatted: [],      
      selected: [],
      page: 0,
      rowsPerPage: 5,      
      renderOnlyDateRangeData: false,
      developmentWorksDateRange: []
    };
  }

  // Function to handle the the request from user to sort by a particular heading.
  handleRequestSort = (event, property) =&gt; {
    const orderBy = property;
    let order = "desc";

    if (this.state.orderBy === property &amp;&amp; this.state.order === "desc") {
      order = "asc";
    }    
    this.setState({ order, orderBy });
  };

  handleSelectAllClick = event =&gt; {
    if (event.target.checked) {
      this.setState(state =&gt; ({
        selected: state.allDevelopmentWorks.map(n =&gt; n._id)
      }));
      return;
    }
    this.setState({ selected: [] });
  };

  handleClick = (event, id) =&gt; {
    const { selected } = this.state;
    const selectedIndex = selected.indexOf(id);
    let newSelected = [];

    if (selectedIndex === -1) {
      newSelected = newSelected.concat(selected, id);
    } else if (selectedIndex === 0) {
      newSelected = newSelected.concat(selected.slice(1));
    } else if (selectedIndex === selected.length - 1) {
      newSelected = newSelected.concat(selected.slice(0, -1));
    } else if (selectedIndex &gt; 0) {
      newSelected = newSelected.concat(
        selected.slice(0, selectedIndex),
        selected.slice(selectedIndex + 1)
      );
    }
    this.setState({ selected: newSelected });
  };

  componentDidMount() {
    axios
      .get("/api/developmenties/")
      .then(res =&gt; {
        this.setState(
          {
            allDevelopmentWorksFormatted: res.data
          },
          () =&gt; {
            this.state.allDevelopmentWorksFormatted.map((item, index) =&gt; {
              if (item.date_of_commencement || item.date_of_completion) {
                this.state.allDevelopmentWorksFormatted[
                  index
                ].date_of_commencement =
                  moment(item.date_of_commencement).format(
                    "MMM D, YYYY 12:00:00 "
                  ) + `AM`;
                this.state.allDevelopmentWorksFormatted[
                  index
                ].date_of_completion =
                  moment(item.date_of_completion).format(
                    "MMM D, YYYY 12:00:00 "
                  ) + `AM`;
              }
            });
          }
        );
      })
      .then(
        axios
          .get("/api/developmenties/paginate", {
            params: {
              page: this.state.page,
              rowsperpage: this.state.rowsPerPage
            }
          })
          .then(res =&gt; {
            console.log("THE RESPONSE FOR PAGINATION IS ", res.data);
            this.setState({
              allDevelopmentWorks: res.data
            });
          })
      )
      .catch(function(error) {
        console.log(error);
      });
  }

  componentDidUpdate(prevProps, prevState) {
    if (

       this.state.developmentWorksDateRange.length !==
    prevState.developmentWorksDateRange.length ||
