Mongoose isDeleted type interference<p>I have implemented soft-delete feature within my MongoDB collections. Now I have problems when I want to update mongoose library version from 4 to 5. The problem is that version 5.x.y of mongoose library supports soft-delete feature on its own (having <code>isDeleted()</code> method) which interferes with my own <code>isDeleted</code> field.</p>

<p>I have something like this:</p>

<pre><code>export class Factory&lt;E&gt; {
  private readonly _model: Model&lt;Document &amp; E&gt;;

  public get model(): Model&lt;Document &amp; E&gt; {
    return this._model;
  }

  constructor(config: IFactoryConfiguration) {
    // ...
    let schema: Schema = new Schema(this.definition);
    this._model = this.connection.model&lt;Document &amp; E&gt;(this.name, schema);
  }
}
</code></pre>

<p>Then I have:</p>

<pre><code>export class UserFactory extends Factory&lt;IUser&gt; {
  constructor(connection: Connection) {
    super({
      connection: connection,
      name: 'User',
      definition: UserSchema
    });
  }
}
</code></pre>

<p>And:</p>

<pre><code>export const UserSchema: SchemaDefinition = {
  // ...
  isDeleted: {
    type: Boolean,
    default: false
  } // ...
}
</code></pre>

<p><code>IUser</code> has <code>isDeleted: boolean;</code> property among others.</p>

<p>Now, I want to create/update system user every time a server is started:</p>

<pre><code>let system = await this.factories.user.model.findOne({
  'isSystem': true
});

if (!system) {
  system = new this.factories.user.model();
  system.isSystem = true;
  system.isDeleted = true; &lt;-- error here
  await system.save();
}
</code></pre>

<p>The problem is that I have <code>isDeleted</code> property inside my collection model (in this case <code>IUser</code>), but mongoose has <code>isDeleted()</code> method inside it's <code>Document</code> class. Since I have an <a href="https://www.typescriptlang.org/docs/handbook/advanced-types.html#intersection-types" rel="nofollow noreferrer">Intersection Type</a> of <code>Document &amp; IUser</code>, I'm getting some interference here. The error I'm getting is:</p>

<blockquote>
  <p>Error:(239, 7) TS2322: Type 'true' is not assignable to type '({ (isDeleted: boolean): void; (): boolean; } &amp; false) | ({ (isDeleted: boolean): void; (): boolean; } &amp; true)'.</p>
</blockquote>

<p>Because there is <code>isDeleted(): boolean;</code> method (take a look <a href="https://github.com/DefinitelyTyped/DefinitelyTyped/blob/73241cf7f67a5c9253700756a94680397ad3ceef/types/mongoose/index.d.ts#L3202" rel="nofollow noreferrer">here</a>). How can I solve this issue?</p>

<p>Specifically, I want to update from</p>

<pre><code>"mongoose": "^4.13.17",
"@types/mongoose": "^4.7.23",
</code></pre>

<p>to</p>

<pre><code>"mongoose": "^5.4.7",
"@types/mongoose": "^5.3.10",
</code></pre>

<p>I'm using</p>

<pre><code>"typescript": "^3.2.2",
</code></pre>

