Mongoose Populate in Node JS/express js<p>I'm trying to link between two mongoose collections. So that user's information are stored in a collection named user, and his content is stored in another collection.
So far I copied some code from <a href="https://medium.com/@nicknauert/mongooses-model-populate-b844ae6d1ee7" rel="nofollow noreferrer">here</a> and edited it;</p>

<p>then with Postman, I created a username named "example";
then I created a post with a random content, and as author I set it "example", but it seems that it doesn't work, when I get '/test' it logs : </p>

<blockquote>
  <p>Populated User { posts: [],   _id: 5c530cd4ede117109cf1a5e9,<br>
  username: 'example',   __v: 0 }</p>
</blockquote>

<p>posts is empty as you see, what should I change in order to fix that?</p>

<pre><code>     const UserSchema = new mongoose.Schema({
      username: String,
      posts: [{
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Post'
      }]
    })
  const PostSchema = new mongoose.Schema({
      content: String,
      author: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'User'
      }
    })

    function getUserWithPosts(username){
      return User.findOne({ username: username })
        .populate('posts').exec((err, posts) =&gt; {
          console.log("Populated User " + posts);
        })
    }

    const Post = mongoose.model('Post', PostSchema, 'posts');
    const User = mongoose.model('User', UserSchema, 'users');

  app.post('/testUser', (req, res) =&gt; {
    var username = req.body.username;
    var clientModel = new User({
      username: username,
    });
    clientModel.save(function (error) {
      if (error) {
        console.log(error);
      }
      res.send({
        success: true,
        username: username,
        message: 'account saved successfully!'
      });
    });
  });

  app.post('/testPost', (req, res) =&gt; {
    var content = req.body.content;
    var author = req.body.author;
    var clientModel = new Post({
      content: content,
      author: author
    });
    clientModel.save(function (error) {
      if (error) {
        console.log(error);
      }
      res.send({
        success: true,
        content: content,
        author: author,
        message: 'account saved successfully!'
      });
    });
  });



  app.get('/test', (req, res) =&gt; {
    res.send({
      posts: getUserWithPosts("example")
    })
  });
</code></pre>

