Can't call .save() after using aggregate<p>I have to use aggregate to find a user ID inside an array of objects, and once I have it I want to update a document with that ID. But when I try to call .save() like I would have after for example using <code>Product.findById(productId)</code>, I get an error which only occurs when I use aggregation.</p>

<blockquote>
  <p>product.save is not a function</p>
</blockquote>

<pre><code>exports.putGift = (req, res, next) =&gt; {
  const productId = req.body.productId;
  const requestId = req.body.requestId;
  Product.aggregate([
    { $match: { _id: mongoose.Types.ObjectId(productId) } },
    { $unwind: "$requests" },
    { $match: { "requests._id": mongoose.Types.ObjectId(requestId) } },
    { $project: { "requests.userId": 1 } }
  ])
    .then(product =&gt; {
      const userId = product[0].requests.userId;
      product.winner = userId;
      product.status = "given";
      return product.save()
      .then(result =&gt; {
        console.log("success");
      });
    })
    .catch(err =&gt; {
      console.log(err);
    });
};
</code></pre>

