<p>I have an array of relevant <code>Metadatas</code> that I've projected to look like this:</p>

<p><code>{ hash: string, application: string }[]</code></p>

<p>Each combination of <code>{ hash, application }</code> is unique within that array. My goal is to find any <code>Logs</code> whose combination of <code>application</code> and <code>hash</code> exist as an item within that array.</p>

<p>So I essentially need to do something like this:</p>

<pre><code>Logs.find(
   { 
      application: { $in: &lt;one particular item from the array&gt;},
      hash: &lt;the hash from the SAME item from that array&gt;
   }
);
</code></pre>

<p>This can be done in my JavaScript, but the collections may be very large, and I'd rather offload it to MongoDB directly. Is there a best way to go about this kind of query?</p>

